data_model.html.body:
Signal K Data ModelFormatsSignal K defines two data formats—full and delta—for representing and transmitting data. All Signal K data is
transmitted as UTF-8 JSON.Full FormatThe full format is conceptually the simplest representation of data in Signal K. It contains all of the data from a
Signal K node, which in the case of a Signal K server could me many hundreds of data points.{
  "version": "1.0.0",
  "self": "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c",
  "vessels": {
    "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c": {
      "navigation": {
        "speedOverGround": {
          "value": 4.32693662,
          "$source": "ttyUSB0.GP",
          "sentence": "RMC",
          "timestamp": "2017-05-16T05:15:50.007Z"
        },
        "position": {
          "value": {
            "altitude": 0.0,
            "latitude": 37.81479,
            "longitude": -122.44880152
          },
          "$source": "ttyUSB0.GP",
          "sentence": "RMC",
          "timestamp": "2017-05-16T05:15:50.007Z"
        },
        "headingMagnetic": {
          "value": 5.55014702,
          "$source": "ttyUSB0.II",
          "sentence": "HDM",
          "timestamp": "2017-05-16T05:15:54.006Z"
        }
      },
      "name": "Motu",
      "uuid": "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c"
    }
  },
  "sources": {
    "ttyUSB0": {
      "label": "ttyUSB0",
      "type": "NMEA0183",
      "GP": {
        "talker": "GP",
        "sentences": {
          "RMC": "2017-04-03T06:14:04.451Z"
        }
      },
      "II": {
        "talker": "II",
        "sentences": {
          "HDM": "2017-05-16T05:15:54.006Z"
        }
      }
    }
  }
}

There are several top level attributes or keys which are always present and others which are optional. The version
key specifies which version of the Signal K specification is being used and must always present in a full Signal K
model. Also always present in the full model is the self key. The value of self is the key within the vessels
object which is the local boat. Effectively, it is a pointer into the vessels object.Below the vessels object is a list of vessels, identified by their MMSI number or a generated unique ID. There may be
many vessels if data has been received from AIS or other sources. The format for each vessel’s data uses the same
standard Signal K structure but may not have the same content; likely you will not have as much data about other
vessels as you have about your own.At the same level as vessels is sources. This contains a list of sources the data was obtained from. Each data
object within a vessel may have a $source key which point to a source within sources. Several data objects may
reference the same source since a single NMEA sentence or PGN may map to multiple keys in Signal K.Alternatively the source data may be embedded directly in place of the $source by using the source key:{
  "vessels": {
    "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c": {
      "navigation": {
        "position": {
          "value": {
            "altitude": 0.0,
            "latitude": 37.81479,
            "longitude": -122.44880152
          },
          "source": {
            "label": "ttyUSB0",
            "type": "NMEA0183",
            "talker": "GP",
            "sentence": "PRMC"
          },
          "timestamp": "2017-05-16T05:15:50.007Z"
        }
      }
    }
  }
}
For more information on sources, see the sources section.Data objects in Signal K are organized hierarchically, for example data related to navigation such as position, speed
through water and heading are all organized under a navigation sub-topic within the vessel object. Each data object
has a value property which holds the actual value for that specific key. The value property may contain a number, a
string or another object. Signal K keys that are object valued are object valued because the values don‘t have much
semantic meaning individually. For example position – latitude doesn‘t have much meaning without an associated
longitude. Therefore, these (and altitude) are grouped together in a single navigation.position key.The values are always SI units, and always the same units for the same key. Therefore, speedOverGround is always
meters per second, never knots, km/hr, or miles/hr. This means you never have to send units with data, the units are
specific for a key, and defined in the data schema. A simplified version of the JSON schema with the units is available
in Keys Reference in Appendix A. The units are also always specified in the values’
metadata which is available via the REST API in the meta.units property.
Besides the units property, meta provides a lot of other useful information for consumers of the data.Finally, each data object also has a timestamp property which represents the time that the value was measured.
Timestamps are in ISO 8601 format – specifically the RFC 3339 extension format,
which is slightly more strict than the ISO specification.  For instance, it requires four digit years and specifies
that T is used as a separator between the data and time portions of the timestamp.The ordering of keys is also not important, they can occur in any order. In fact, if you are designing a device which
consumes Signal K data, it is important to remember that the JSON standard does not guarantee the order of properties
in an object. You MUST NOT rely on the data you receive to always be in the same order within a Signal K message.The full format is most useful for getting the initial state of a Signal K system, for example when a display device
first connects to the network or for refreshing a device‘s state when it loses a network connection.However sending the full data model is wasteful of both bandwidth and CPU, especially when there is a large amount of
available data, or the consuming device is only interested in a small portion of it. In the majority of cases, it is
preferable to only exchange small, specific portions of the data.Delta FormatBy far, the most commonly produced Signal K format is the delta format. Conceptually, the delta is an update to an
existing Signal K data model. A device consuming deltas could either build up a view of the Signal K full tree by
consuming and combining deltas or it could request from a Signal K server the current full tree model and apply deltas
to that as they are received. It is also entirely possible for a device to remain essentially stateless and treat
Signal K deltas as independent packets of data, much the same way as it would handle NMEA sentences or PGNs.An example delta message is presented below.{
  "context": "vessels.urn:mrn:imo:mmsi:234567890",
  "updates": [
    {
      "source": {
        "label": "N2000-01",
        "type": "NMEA2000",
        "src": "017",
        "pgn": 127488
      },
      "timestamp": "2010-01-07T07:18:44Z",
      "values": [
        {
          "path": "propulsion.0.revolutions",
          "value": 16.341667
        },
        {
          "path": "propulsion.0.boostPressure",
          "value": 45500
        }
      ]
    }
  ]
}
The top level of a delta message contains an updates property and an optional context property.{
  "context": "vessels.urn:mrn:imo:mmsi:234567890",
  "updates": [...]
}
The optional context property roots the updates to a particular location in the Signal K tree. If context is
missing it is assumed that the data is related to the self context. The self context is the vessel object which
the self property of the full model points to.Context is a path from the root of the full tree to the container object, which for vessel related data must refer to
a vessel directly under vessels. The delimiter in the context path is . (period). In this case the context is
vessels.urn:mrn:imo:mmsi:234567890. All subsequent data is relative to that location.The updates property holds a JSON array of update objects, each of which may have a  source property, a timestamp
property and an array of values containing one or more value objects.{
  "source": {
    "label": "N2000-01",
    "type": "NMEA2000",
    "src": "115",
    "pgn": 128267
  },
  "timestamp": "2014-08-15T16:00:00.081Z",
  "values": [
    {
      "path": "navigation.courseOverGroundTrue",
      "value": 2.971
    },
    {
      "path": "navigation.speedOverGround",
      "value": 3.85
    }
  ]
}
An update has a single source value and it applies to each of the values items. In cases where data can only
come from a single source, such as an NMEA 0183 talker connected to a serial port, then the source may be omitted.
However, if the delta is being passed on by a Signal K server or multiplexer then source must be filled in by the
server so that downstream consumers can discern where the update comes from.In cases where a Signal K producer does not have access to a real time clock or GPS time then timestamp should be
omitted. Elements in the Signal K processing chain-such as a server receiving data from a producer-should fill in
timestamp if it is missing in the incoming delta message.Each value item is then simply a pair of path and value. The path must be a leaf path: it must be a path to
a leaf the of the full model.  A leaf is where the actual value of the Signal K property is and where timestamp,
$source and values properties are in the full model. The value is often a scalar-a single numeric value, as in the
example above-but it can also be an object. For example a navigation.position value would be an object like
{"latitude": -41.2936935424, "longitude": 173.2470855712}.There are some static properties in the full model that lack the support for multiple values and metadata such as
source and timestamp. An example is a vessel‘s name, directly under the vessel‘s root. This static data may appear in
the delta stream, for example when received in AIS transmission. In this case the value should be the subtree of the
full model, starting from the vessel's root, with just the relevant parts, and the path must be empty, indicating that
the value should be merged to the full model mounted where the delta‘s context property points:{
  "context": "vessels.urn:mrn:imo:mmsi:234567890",
  "updates": [
    {
      "source": {...},
      "timestamp": "2014-08-15T19:02:31.507Z",
      "values": [
        {
          "path": "",
          "value": {
            "name": "WRANGO"
          }
        }
      ]
    }
  ]
}
Data QualityData transmitted in Signal K format is assumed to be corrected for known sensor inaccuracies such as wind angle offset
due to misalignment of a masthead unit on the mast, but there is no guarantee that data is accurate, or within
certain bounds. Different sources will have different data quality and normal vigilance is always required.Missing or Invalid DataA sensor or gateway/server may want to send a message indicating known invalid data or the fact that the sensor is
functioning but can not provide data, for example when a depth sensor has no bottom fix. In this case the value must be
JSON null in the delta message and the server must return the value as a JSON null in the REST API.Message IntegrityMany messaging systems specify checksums or other forms of message integrity checking. Signal K assumes a reliable
transport will guarantee a valid message. This is true of TCP/IP and some other transports but not always the case. For
other transports (e.g. RS-232 serial) a specific extended data format will apply, which is suited to that transport.
Hence at the message level no checksum or other tests need to be made.Encoding/DecodingThe JSON message format is supported across most programming environments and can be handled with any convenient
library.On micro-controllers with limited RAM it may be necessary to read and write Signal K data using a streaming process
rather than reading the entire message into RAM before processing. There is an implementation of Signal K JSON
streaming on an Arduino Mega (4K RAM) in the related
Freeboard project.

data_model_multiple_values.html.body:
Multiple Values for a KeyThere are two use cases for multiple values for a single data pointMultiple instances of a common device-e.g. two engines or multiple batteries.

Multiple devices providing duplicate data-multiple values for the same Signal K key from different sensors. This is
fairly common as most boats have multiple sensors capable of generating the same data (but not necessarily the same
value). For example, course over ground (COG) may come from both a compass and GPS or a boat may be equipped with
multiple depth sounders.

Multiple Instances of a Common DeviceSome parts of the Signal K schema are device oriented.For example, many boats have multiple batteries. However each battery has multiple, common quantities like voltage,
current and temperature. In this case, it makes more sense for these values to be organized by instance. Therefore, in
the Signal K model, each battery bank is it’s own instance: for example electrical.batteries.starter and
electrical.batteries.house. Then beneath that prefix there are the various properties for each battery.This organisation allows a user interface to organise the individual readings in meaningful groups and allows consumers
to query all the values related to that piece of equipment via the REST API. Furthermore, this structure maintains the
primary requirement that a given data value have a fixed and unique URI, but gives flexibility in the structure and
complexities of data.The same device centric organisation is used within the propulsion subschema, to support the common use case of two
engines via propulsion.port and propulsion.starboard.The values starter, house, port and starboard are examples and not specified in the schema. You are free to
use application specific values within the regexp specified in the JSON schema.Multiple Devices Providing Duplicate DataIt is quite possible for a key value to come from more than one device. Many modern devices have a built in GPS
receiver and as a result on any given boat there may be several sources of position, speed over ground, and heading.
Multiple depth sounders are also common, often installed to port and starboard on monohull sailboats or in each hull of
a catamaran.Given that the validity of these various sources of data may change in a context-specific way, Signal K provides a
mechanism for these values to be grouped together so that the consumer of the data may choose which value (or values)
to display1.When dealing with multiple sources of data, it becomes important to know where the data is coming from. Signal K
provides a mechanism for that in the form of the sources top level object and references into that object via the
$source property. See sources for detailed information on the structure of the sources object and how
it is referenced by the $source property.The first source of a particular data point becomes the default source for that data and a normal Signal K object is
created.{
  "self": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "version": "0.9.0",
  "vessels": {
    "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": {
      "uuid": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
      "navigation": {
        "courseOverGroundTrue": {
          "value": 3.61562407843144,
          "$source": "ttyUSB0.GP",
          "timestamp": "2017-04-03T06:14:04.451Z"
        }
      }
    }
  }
}
It has come from device sources.ttyUSB0.GP, where further details can be found.If another value with different source arrives, the Signal K server will add the values attribute with values from
both the first and second sources. The initial source‘s data will continue to populate the value property in the key.{
  "self": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "version": "0.9.0",
  "vessels": {
    "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": {
      "uuid": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
      "navigation": {
        "courseOverGroundTrue": {
          "value": 3.615624078431440,
          "$source": "ttyUSB0.GP",
          "timestamp": "2017-04-03T06:14:04.451Z",
          "values":{
            "ttyUSB0.GP.RMC":{
              "value": 3.615624078431440,
              "timestamp": "2017-04-03T06:14:04.451Z"
            },
            "n2k.ikommunicate.128267":{
              "value": 3.615624078431453,
              "timestamp": "2017-04-03T06:14:04.451Z"
            }
          }
        }
      }
    }
  },
  "sources":{
    "ttyUSB0": {
      "GP": {
        "sentences": {
          "RMC": "2017-04-03T06:14:04.451Z"
        }
      }
    },
    "ikommunicate": {
      "2": {
        "n2k": {
          "src": "2",
          "pgns": {
            "128267": "2017-04-03T06:14:05.221Z"
          }
        }
      }
    }
  }
}

Multiple Values in Delta MessagesWhen a client subscribes to navigation.courseOverGroundTrue, they receive all the values held. The update message
does not include the values path, the case above looks like:{
  "context": "vessels.urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "updates": [
    {
      "source": {
        "label": "GPS-1",
        "type": "NMEA0183",
        "talker": "GP",
        "sentence": "RMC"
      },
      "timestamp": "2017-04-03T06:14:04.451Z",
      "values": [
        {
          "path": "navigation.courseOverGroundTrue",
          "value": 3.615624078431440
        }
      ]
    },
    {
      "source": {
        "label": "actisense",
        "type": "NMEA2000",
        "src": "115",
        "pgn": 128267
      },
      "timestamp": "2017-04-03T06:14:04.451Z",
      "values": [
        {
          "path": "navigation.courseOverGroundTrue",
          "value": 3.615624078431453
        }
      ]
    }
  ]
}
Individual updates can be distinguished by their source.If a client wants only the values of a specific source it should subscribe to a path that includes the full path under
values including the source reference key of the source. The source reference should be enclosed in square brackets:
navigation.courseOverGroundTrue.values[n2k./dev/ikommunicate.128267]. The client can retrieve the relevant data via
REST API.Note: The exact format of the update message is affected by the subscription policy. A policy of instant will
result in changes being sent immediately, so typically one item in values per update. A policy of fixed will result
in periodic updates which may contain many items in values.The update allows grouping values by source.[1] Specifying preferred sources is still an under-development enhancement to the Node
server.

sources.html.body:
Signal K Data SourcesSignal K provides a method to identify the specific device and—if available—the NMEA sentence or PGN which generated a
particular value. This is handled in two ways. The first is with a pointer to a device in the sources section of the
Signal K data model. When viewing a full Signal K data model, this is the method you will see. Every Signal K data
object will have a $source property (note the dollar sign sigil which indicates the value is a pointer) which
contains a dot separated path to an object relative to the top-level sources section. When receiving Signal K data
via deltas, you may also see sources referenced this way. However, all current implementations of Signal K provide
source data directly embedded in the delta message. This is done using the source property of the delta message.Pointer MethodAn example of the pointer method is shown below.{
  "version": "1.0.0",
  "self": "vessels.urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c",
  "vessels": {
    "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c": {
      "uuid": "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c",
      "navigation": {
        "speedOverGround": {
          "value": 4.32693662,
          "$source": "ttyUSB0.GP",
          "sentence": "RMC",
          "timestamp": "2017-05-16T05:15:50.007Z"
        }
      }
    }
  },
  "sources": {
    "ttyUSB0": {
      "label": "ttyUSB0",
      "type": "NMEA0183",
      "GP": {
        "talker": "GP",
        "sentences": {
          "RMC": "2017-04-03T06:14:04.451Z"
        }
      }
    }
  }
}
This is a full Signal K model with a single data source and a single data object. The navigation.speedOverGround
object references the ttyUSB0.GP device via the value of the $source property. In addition to $source, the
sentence property is also included which identifies the specific NMEA 0183 sentence recieved from the data source
which was converted to Signal K.Within the sources section devices are conventionally organized by the physical connection to the Signal K device and
an identifier for the specific source device. In the case above, the first level of the hierarchy is the UNIX device
identifier for a USB serial port and the second level is the NMEA 0183 talker ID of the paddlewheel sensor.Direct Inclusion MethodThis method is only implemented in delta messages. An example delta with an inline source is shown below.{
  "updates": [
    {
      "source": {
        "label": "ttyUSB0",
        "type": "NMEA2000",
        "pgn": 127251,
        "src": "204"
      },
      "timestamp": "2017-04-15T20:38:26.709Z",
      "values": [
        {
          "path": "navigation.rateOfTurn",
          "value": -0.000412469
        }
      ]
    }
  ],
  "context": "vessels.urn:mrn:imo:mmsi:338184312"
}
This particular source is an NMEA 2000 device so it has the pgn and src properties, but NMEA 0183 or other source
types are similarly supported. An NMEA 0183 source would be structured like this:{
  "label": "NMEA0183-0",
  "type": "NMEA0183",
  "sentence": "RMC",
  "talker": "GP"
}
A final example using a non-NMEA source, in this case an I²C sensor.{
  "type": "I2C",
  "label": "I²C Bus #0",
  "src": "14"
}
Here, src is the address of the device on the I²C bus.Sources GroupA Signal K device capable of generating a full data model will have a top level (i.e. at the same level as vessels,
version and self) group called sources. This group provides detailed information about each network bus connected
to the Signal K gateway or server. Sources are organized hierarchically, following a bus-source-type structure.An example of multiple sources is shown below.{
  "vhf": {
    "label": "AIS Receiver",
    "type": "VHF",
    "112334556": {
      "ais": {
        "aisType": 15
      }
    },
    "394299113": {
      "ais": {
        "aisType": 15
      }
    }
  },
  "ttyUSB0": {
    "label": "NMEA 0183",
    "type": "NMEA0183",
    "II": {
      "talker": "II",
      "sentences": {
        "VHW": "2018-04-16T01:34:03.881Z"
      }
    }
  },
  "ttyUSB1": {
    "label": "NMEA 2000",
    "type": "NMEA2000",
    "3": {
      "1": {},
      "2": {},
      "n2k": {
        "src": "3",
        "pgns": {
          "126992": "2017-04-15T18:44:59.006Z"
        }
      }
    }
  }
}
You may notice two odd lines in the NMEA 2000 source "3": "1": {} and "2": {}'. These are placeholders for NMEA
2000 "instance" values. These are here to provide a valid schema for certain NMEA 2000 PGNs relating to temperature.
Because temperature paths in the current versio of Signal K do not have the instance inline, consumers must look at the
instance part of the $source or source property to determine which specific sensor provided the data.

subscription_protocol.html.body:
Subscription ProtocolIntroductionBy default a Signal K server will provide a new WebSocket client with a delta stream of the vessels.self record, as
updates are received from sources. E.g. /signalk/v1/stream will provide the following delta stream, every time the
log value changes.{
  "context": "vessels.urn:mrn:imo:mmsi:234567890",
  "updates": [
    {
      "source": {
        "label": "N2000-01",
        "type": "NMEA2000",
        "src": "115",
        "pgn": 128275
      },
      "values": [
        {
          "path": "navigation.trip.log",
          "value": 43374
        },
        {
          "path": "navigation.log",
          "value": 17404540
        }
      ]
    }
  ]
}
Below we refer to WebSockets, but the same process works in the same way over any transport. E.g. for a raw TCP
connection the connection causes the above message to be sent, and sending the subscribe messages will have the same
effect as described here.This can be a lot of messages, many you may not need, especially if your boat has many sensors, or other data sources.
Often you will want to subscribe to a much smaller range of data. Especially for single value displays, it does not
make sense to get the entire data stream when only a single value is wanted.First you will want to unsubscribe from the current default (or you may have already connected with
ws://hostname/signalk/v1/stream?subscribe=none). To unsubscribe all create an unsubscribe message with wildcards
and send the message over the WebSocket connection:{
  "context": "*",
  "unsubscribe": [
    {"path": "*"}
  ]
}
To subscribe to the required criteria send a suitable subscribe message:{
  "context": "vessels.self",
  "subscribe": [
    {
      "path": "navigation.speedThroughWater",
      "period": 1000,
      "format": "delta",
      "policy": "ideal",
      "minPeriod": 200
    },
    {
      "path": "navigation.logTrip",
      "period": 10000
    }
  ]
}
path=[path.to.key] is appended to the context to specify subsets of the context.
The path value can use the wildcard *. A wildcard in the middle of a path (propulsion/*/oilTemperature) allows any
value for that part and a wildcard at the end (propulsion/port/*) matches all paths beginning with the specified
prefix.

The following are optional, included above only for example as it uses defaults anyway:period=[millisecs] becomes the transmission rate, e.g. every period/1000 seconds. Default: 1000

format=[delta|full] specifies delta or full format. Default: delta

policy=[instant|ideal|fixed]. Default: idealinstant means send all changes as fast as they are received, but no faster than minPeriod. With this policy the
 client has an immediate copy of the current state of the server.

ideal means use instant policy, but if no changes are received before period, then resend the last known
values.

fixed means simply send the last known values every period.


minPeriod=[millisecs] becomes the fastest message transmission rate allowed, e.g. every minPeriod/1000 seconds.
  This is only relevant for policy='instant' to avoid swamping the client or network.
You can subscribe to multiple data keys multiple times, from multiple apps or devices. Each app or device simply
subscribes to the data it requires, and the server and/or client implementation may combine subscriptions to avoid
duplication as it prefers on a per connection basis. At the same time it is good practice to open the minimum
connections necessary, for instance one WebSocket connection shared between an instrument panel with many gauges,
rather then one WebSocket connection per gauge.Multiple value handling in subscriptionsA subscription to a key is for all the updates to that key. If there are multiple sources generating data for that key
the client will get all their updates.If a client wants only the values of a single source it should subscribe to a path that includes the full path under
values including the source reference key of the source. The source reference should be enclosed in square brackets:
navigation.speedThroughWater.values[n2kFromFile.43]. The client can retrieve the relevant data via REST API. See
Multiple Values for more information.Single use, or intermittent dataWhen data is required once only, or upon request the subscribe/unsubscribe method should not be used. If the client
is http capable the REST API is a good choice, or use get/list/put messages over WebSockets or TCP.Use Cases and Proposed SolutionsLocal boat individual instrumentsA gauge-type display for just one or a few data items for the 'self' vessel should be able to specify that it only
wants those items for the self vessel.This can be achieved by a default WebSocket connection /signalk/v1/stream?subcribe=none, then sending a JSON message:{
  "context": "vessels.self",
  "subscribe": [
    {
      "path": "environment.depth.belowTransducer"
    },
    {"path": "navigation.speedThroughWater"}
  ]
}
The JSON format is also viable over a simple TCP or serial transport, and is therefore supported as the primary
subscription method.Map display with all known vessel positions & directions, served over 3G cellular connection{
  "context": "vessels.*",
  "subscribe": [
    {
      "path": "navigation.position",
      "period": 120000,
      "policy": "fixed"
    },
    {
      "path": "navigation.courseOverGround",
      "period": 120000,
      "policy": "fixed"
    }
  ]
}
The result is a delta message of the Signal K data with just position and courseOverGround branches for all known
vessels, sent every 2 minutes (120 seconds) even if no data has been updated.Position of a certain vessel, immediately it changes, but once per minute at most{
  "context": "vessels.230029970",
  "subscribe": [
    {
      "path": "navigation.position",
      "minPeriod": 60000,
      "policy": "instant"
    }
  ]
}
The result will be delta position messages for vessel 230029970, broadcast whenever it changes, but with minimum
interval of 60 seconds. Messages are delayed to meet the minimum interval with newer messages overriding the previous
message in the buffer.

notifications.html.body:
Alarm, Alert, and Notification HandlingHandling alarms, alerts, and notifications in Signal K is a multi-stage process. Alarms, alerts and notifications are
all handled the same way, and are all referred to as alarms below.We need a flexible model to define alarm conditions, and a standard way to announce and record them.Alarm ProcessDefine alarm states as zones in the meta object attached to any Signal K value. See [[Metadata for Data Values]]

If the value is within an alarm zone raise the defined alarm.

If the value goes out of the zone, remove the alarm by setting its value to null

Alarms are raised by placing an alarm object in the vessels.self.notifications tree

Expected implementation behaviourThe server (or device) should monitor the current value and compare it to the defined zones.

If a value enters an alarm zone, then a key is written to vessels.self.notifications..

If a value leaves an alarm zone, then the key is removed from vessels.self.notifications..

Alarms raised are monitored by an alarm process on the server, which takes appropriate action, sounding alarms, or
displaying messages.

Clients interested in alarms can subcribe to the vessels.self.notifications... tree in the usual way and be informed
of alarms in the same way as normal signalk keys.

When an alarms is removed, a delta should be sent to subscribers with the path and a null value.

Exampleeg If we exceed our anchor alarm radius: vessels.self.navigation.anchor.currentRadius enters
vessels.self.navigation.anchor.currentRadius.meta.zones[[50,500, "alarm", "Dragging anchor!"]],The alarm is : vessels.self.notifications.navigation.anchor.currentRadiusThe alarm object is{
  "value": {
    "method": ["sound"],
    "state": "alarm",
    "message": "Dragging anchor!"
  },
  "timestamp": "...",
  "$source": "..."
}
The server alarm manager will see this new entry and turn on the alarm. Using a manager process allows flexibility in
situations where multiple alarms are triggered and your vessel is a mass of flashing and beeping. eg A single 'Pause'
button can give you 5-10 minutes to take action, stopping annoying noise, and removing popup messages from screens.Since the vessels.self.notifications tree mirrors the other data in the signal k model, we can selectively watch or
react to specific branches or keys. When displaying multiple alarms a screen can also sort and filter them.Other AlarmsAbove we have discussed monitoring existing values and raising alarms. There are other alarms that must be considered,
eg MOB, fire, sinking etc, and misc alerts "GPS signal lost".etc.The vessels.[uuid].notifications tree is the same as any other Signal k branch. Keys can be added and removed as
required in the usual way. Since the branch is being monitored we only need to add a key of any sort to create a
suitable alarm.In the case of an emergency, create a unique key: The alarm is : vessels.[uuid].notifications.[alarm.key]The alarm object is{
  "value": {
    "method": ["visual", "sound"],
    "state": "emergency",
    "message": "Man Overboard!"
  },
  ...
}
Alarm objects that have been raised this way must be cleared manually, or by the process that created them. You can use
any suitable path, keeping in mind the context of the alarm.eg In the case of an alert, create a unique key by generating a path: The alarm is :
vessels.[uuid].notifications.navigation.gnssThe alarm object is{
  "value": {
    "method": ["visual"],
    "state": "alert",
    "message": "GPS signal lost!"
  },
  ...
}
Well Known NamesSome alarms are especially important, eg MOB. This is a list of keys for special alarms...notifications.mob.*

..notifications.fire.*

..notifications.sinking.*

..notifications.flooding.*

..notifications.collision.*

..notifications.grounding.*

..notifications.listing.*

..notifications.adrift.*

..notifications.piracy.*

..notifications.abandon.*

An example to send an MOB alarm from an N2K source, the gateway would convert and send something like:{
  "context": "vessels.urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "updates": [
    {
      "source": {...},
      "timestamp": "2017-08-15T16:00:05.200Z",
      "values": [
        {
          "path": "notifications.mob",
          "value": {
            "message": "MOB",
            "state": "emergency",
            "method": ["visual", "sound"]
          }
        }
      ]
    }
  ]
}
The resulting full signalk tree would be:{
  "vessels": {
    "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": {
      "uuid": "...",
      "notifications": {
        "mob": {
          "value": {
            "method": ["visual", "sound"],
            "state": "emergency",
            "message": "Man Overboard!"
          },
          "timestamp": "2017-04-10T08:33:53Z",
          "$source": "..."
        }
      }
    }
  },
  ...
}
To clear the alarm condition, send:{
  "context": "vessels.urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "updates": [
    {
      "source": {...},
      "timestamp": "2017-08-15T16:00:05.538Z",
      "values": [
        {
          "path": "notifications.mob",
          "value": null
        }
      ]
    }
  ]
}
Multiple cases of the same alarmShould multiple cases of the same alarm occur (eg a gps loses signal, then a second gps loses signal) the alarms are
handled the same as any other multiple values in signalk. However alarms will tend to be re-issued whenever the
underlying data changes.The servers alarm monitoring processes are expected to be smart enough to know that the anchor alarm is triggered, and
its not necessary to raise a second copy of the same alarm, after all there is only one boat dragging!This may be handled differently for notifications. It may be useful to know that your gps's are all failing
intermittently, or that . Hence the handling of multiple copies of alarms is an implementation issue, and may vary.The key should be uniqueIf we have an alarm vessels.self.notifications.navigation.anchor.currentRadius and we attempt to write another higher
in the same tree at vessels.self.notifications it must not replace or remove the existing alarm. Since the
meta.zones structure is only valid on signalk leaf values this occurs naturally in most circumstances. But it is
possible to set an alarm value arbitrarily (eg MOB) and care should be taken in implementations that keys do not
overwrite existing paths.

request_response.html.body:
Request/ResponseRequests are used to ask the server to take specific actions. This shows how requests should be formed by the client and how the reponses should look. The details of different request types are defined in other parts of the specification.WebSockets and Other Full-duplex ProtocolsThe exact format of the message for a specific request is defined elsewhere in the specification.A request must include a client generated requestId. TherequestId is a string and it must be a version 4 UUID. It will always be included in any response to the request by the server.For example, a request to PUT a value:{
  "requestId": "123345-23232-232323",
  "put": {
    "path": "electrical.switches.anchorLight.state",
    "value": 1
  }
}
The server will respond with a message which includes the requestId, a state, and a statusCode.The state can be PENDING or COMPLETED.The statusCode will be any standard HTTP code including the following.200 - the request was successful

400 - something is wrong with the client's request

401 - the request has not been applied because it lacks valid authentication credentials

403 - the client does not have permission to make the request

405 - the server does not support the request

502 - something went wrong carrying out the request on the server side

504 - timeout on the server side trying to carry out the request

The message can optionally contain an informational, human oriented message.The response object may contain other response data depending on the specific request being made. For example, a response to
an authentication request could contain a login object.{
  "requestId": "123345-23232-232323",
  "state": "COMPLETED",
  "statusCode": 200,
  "login": {
    "token": "....."
  }
}
A server may respond to a request multiple times depending on how it processes the request.When a server cannot process the request immediately, it will respond with the state PENDING:{
  "requestId": "123345-23232-232323",
  "state": "PENDING",
  "statusCode": 202
}
When processing is done, but it was not successful:{
  "requestId": "123345-23232-232323",
  "state": "COMPLETED",
  "statusCode": 502,
  "message": "Unable to contact the light"
}
When processing completed successfully:{
  "requestId": "123345-23232-232323",
  "state": "COMPLETED",
  "statusCode": 200
}
The state of a request can also be found by sending the following:{
  "requestId": "123345-23232-232323",
  "query": true
}
This will result in a reply like the examples above.HTTPHTTP requests use REST API semantics and the responses are similar to the response object used above.One difference is that the statusCode value is also sent as the HTTP response code.The response when a server successfully processes a login request synchronously:HTTP response code 200{
  "requestId": "123345-23232-232323",
  "state": "COMPLETED",
  "token": "eyJhbGciOiJIUzI1NiI...aQ8sN1XBAP8bt3tNBT1WiIttm3qM",
  "statusCode": 200
}
When a request is PENDING, an HTTP 202 (Accepted) code will be returned and the body will include an href to use to
check the status of the request. A client should then periodically poll the server to get the status. A client should not poll the server at a rate less than 500ms.HTTP response code 202{
  "requestId": "123345-23232-232323",
  "state": "PENDING",
  "href": "/signalk/v1/api/actions/12567",
  "statusCode": 202
}
The contents of the response message when checking the status will include the values defined above for the result
object and may also include extra information related to the request.For example, the result of a PUT request:{
   "requestId": "123345-23232-232323",
   "state": "COMPLETED",
   "statusCode": 200
}

put.html.body:
PUT RequestsPUT requests are sent to a server to request a change to a value. For example, a client would use PUT to switch the
anchor light on or off, change the heading of the autopilot, or set position of the anchor.See Request/Response for more details on request/response in Signal K.Making a Request to Change a ValueTo change a value, a PUT request should be sent via HTTP or using a Signal K put delta.The source field is optional. If a request is sent without the source and there is more than one source for the
value, the server should respond with a 400 (Bad Request) HTTP status code.Via HTTPPUT http://localhost:3000/signalk/v1/api/vessels/self/steering/autopilot/target/headingTrue
{
  "value": 1.52,
  "source": "actisense.204",
}
Via a Delta{
  "context": "vessels.self",
  "correlationId": "184743-434373-348483",
  "put": {
    "path": "steering.autopilot.target.headingTrue",
    "source": "actisense.204",
    "value": 1.52
  }
}
HTTP Error ResponseHTTP response code 403 (Forbidden)JSON response body:{
  "state": "COMPLETED",
  "statusCode": 403
}
HTTP Success ResponseHTTP response code 200 (OK)JSON response body:{
  "state": "COMPLETED",
  "statusCode": 200
}
HTTP Success Response Indicating a Long Running TaskThe response in this case includes an optional href that can be used to check the status of the request.HTTP response code 202 (Accepted)JSON response body:{
  "state": "PENDING",
  "href": "/signalk/v1/actions/12567"
}
A client may periodically GET the URL provided above to check the status of the request.Response Indicating Successful Completion{
   "context": "vessels.self",
   "state": "COMPLETED",
   "statusCode": 200,
}
Response Indicating Failure{
   "context": "vessels.self",
   "state": "COMPLETED",
   "statusCode": 502,
   "message": "Unable to reach device",
}
Response Indicating Process is in ProgressNote: progress is optional and is specified as a ratio (a number from zero to one){
   "context": "vessels.self",
   "state": "PENDING",
   "progress": 0.45
}

versioning.html.body:
Versioning in Signal K specificationOur versioning is based on http://snowplowanalytics.com/blog/2014/05/13/introducing-schemaver-for-semantic-versioning-of-schemas/Most of this document is reproduced from there.When versioning a data schema, we are concerned with the backwards-compatibility between the new schema and existing data represented in earlier versions of the schema. This is the fundamental building block of SchemaVer, and explains the divergence from Semantic Versioning.Heres a simple formula for our SchemaVer:Given a version number MODEL.REVISION.ADDITION-SUFFIX, increment the:MODEL - when you make a breaking schema change which will prevent interaction with any historical data

REVISION - when you make a schema change which may prevent interaction with some historical data

ADDITION - when you make a schema change that is compatible with all historical data

SUFFIX - optional - denotes special versions or active development eg alpha-1, SNAPSHOT
The first released version of Signal K will be 1.0.0.
The current development version will then move to be 1.0.1-SNAPSHOT
The next release candidate might then be 1.0.1-alpha-1

The current development version will then move to be 1.0.2-SNAPSHOT

SNAPSHOT denotes a version under active change. If you depend on the SNAPSHOT version then every time you build your project it will have changed with what-ever was committed since last time you checked.Let’s make SchemaVer more concrete with some examples using some (truncated and contrived) Signal K Schemas, in reverse order:AdditionWe have an existing JSON Schema, let’s call this 1.0.0:{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/demospecification/1.0.0/schemas/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
      "dscAddress": {
      "type": "string",
      "description": "MMSI Callsign for VHF communication"
    }
  },
  "required": ["dscAddress"],
  "additionalProperties": false
}
Now we want to add an additional field to our schema:{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/demospecification/1.0.1/schemas/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
    "dscAddress": {
      "type": "string",
      "description": "MMSI Callsign for VHF communication"
    },
    "phoneNumber": {
      "type": "string",
      "description": "Phone number of skipper",
      "example": "+64xxxxxx"
    }
  },
  "required": ["dscAddress"],
  "additionalProperties": false
}
Because our new phoneNumber field is not a required field, and because version 1.0.0 had additionalProperties set to false, we know that all historical data will work with this new schema, ie. any json which validates against 1.0.0 will also be valid against 1.0.1.Therefore we are looking at an ADDITION, and so we bump the schema version to 1.0.1.RevisionLet’s now make our JSON Schema support additionalProperties - this constitutes another ADDITION, so we are now on 1.0.2:{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/demospecification/1.0.2/schemas/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
    "dscAddress": {
      "type": "string",
      "description": "MMSI Callsign for VHF communication"
    },
    "phoneNumber": {
      "type": "string",
      "description": "Phone number of skipper",
      "example": "+64xxxxxx"
    }
  },
  "required": ["dscAddress"],
  "additionalProperties": true
}
After a while, we add a new field, callsignHf:{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/demospecification/1.1.0/schemas/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
    "dscAddress": {
      "type": "string",
      "description": "MMSI Callsign for VHF communication"
    },
    "phoneNumber": {
      "type": "string",
      "description": "Phone number of skipper",
      "example": "+64xxxxxx"
    },
    "callsignHf": {
      "type": "string",
      "description": "Callsign for HF communication",
      "example": "ZL3RTH"
    }
  },
  "required": ["dscAddress"],
  "additionalProperties": true
}
Will this new schema validate all historical data? Unfortunately we can’t be certain, because there could be historical JSONs where the analyst added their own callsignHf field which was not a string.So we are effectively making a REVISION to the data schema - so we bump the version to 1.1.0 (resetting ADDITION to 0).ModelOh dear - we have just realized that not every-one has DSC! It should have been a VHF callsign. Here is our new JSON Schema:{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/demospecification/2.0.0/schemas/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
    "callsignVhf": {
      "type": "string",
      "description": "Callsign for VHF communication",
      "example": "ZL1234"
    },
    "phoneNumber": {
      "type": "string",
      "description": "Phone number of skipper",
      "example": "+64xxxxxx"
    },
    "callsignHf": {
      "type": "string",
      "description": "Callsign for HF communication",
      "example": "ZL3RTH"
    }
  },
  "required": ["callsignVhf"],
  "additionalProperties": false
}
We have changed our MODEL - because we can have no reasonable expectation that any of the historical data can interact with this schema. That means our new version is 2.0.0Note that we also decided to use this “reboot” of the MODEL to change additionalProperties back to false, because (as we have learnt) it will help us to avoid unnecessary REVISIONs in the future.Note: https://signalk.org/demospecification/... is not real, it is just used here for illustration. The real schemas are located at: https://signalk.org/specification/...Supplementary rulesIn Signal K we have a few variations from SchemaVer:We use dots (.) to separate the version parts, not hyphens (-s) as in SchemaVer

We use a suffix to denote in-progress or special releases, as commonly seen in Maven
